import "./Section6.scss";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import { NavLink, withRouter } from "react-router-dom";
import { connect } from "react-redux";
import React, { useState, useEffect } from "react";
import $ from "jquery";

function Section6({ text4 = [], displaymode1 }) {
  useEffect(() => {
    $(".navbar").css("position", displaymode1);
  });
  return (
    <>
      <div id="up" className="Meeting">
        <div className="meetingcontent">
          <div className="meetingtitle"> Tədbirlər </div>

          <div className="meetingdivs">
            {text4.slice(0, 3).map((tex) => {
              return (
                <>
                  <div className="meetingdiv">
                    <div className="alt">
                      <div className="time">
                        18/12/21
                        <div className="timetwo">18:00 </div>
                      </div>
                      <p className="rootTitle">{tex.title}</p>
                      <p className="rootTitleMini">Masterclass</p>
                      <div className="time-button">
                        <button
                          type="submit"
                          name="subscribe"
                          value="Subscribe"
                          class="btn btn-1"
                        >
                          <svg>
                            <rect
                              x="0"
                              y="0"
                              fill=""
                              width="100%"
                              height="100%"
                            />
                          </svg>
                          <span className="span-text-abune">BOOK NOW</span>
                        </button>
                      </div>
                    </div>
                  </div>
                </>
              );
            })}
          </div>
        </div>
      </div>
    </>
  );
}

const mapStateToProps = (state, ownProps) => {
  return {
    text4: state.text4,
    displaymode1: state.displaymode1
  };
};

export default connect(mapStateToProps)(Section6);
